import React from "react";
import "./AboutSection.css"

const AboutSection = () => {
  return <div id="about-container">
        <h1 id="about-title">About us</h1>
        <p id="about-text">We are a local, family-owned company providing repair services for a wide range of appliance brands and types. Our technicians, each with 5-10 years of experience, are certified by major American appliance brands. Also, we are a licensed, bonded, and insured company. All services are performed on-site and using only original parts. Our contractor license number is MAJORAR785C2. Below, you will find a list of our services along with other relevant details. Please feel free to give us a call with any questions, particularly if the service you require is not listed. We are always happy to assist you!</p>
    </div>
};

export default AboutSection;
